// ÿ•ŸÜÿ¥ÿßÿ° ŸÖŸÑŸÅ ÿ¨ÿØŸäÿØ: src/pages/employee/SeparatedGames.jsx

import React, { useState, useEffect } from 'react';
import authService from '../../services/authService';
import './SeparatedGames.css';

const SeparatedGames = () => {
  const [availableGames, setAvailableGames] = useState([]);
  const [rentedGames, setRentedGames] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [activeTab, setActiveTab] = useState('available'); // 'available', 'rented'

  useEffect(() => {
    loadGames();
  }, []);

  const loadGames = async () => {
    try {
      setLoading(true);
      setError('');
      
      // ÿ¨ŸÑÿ® ÿßŸÑÿ£ŸÑÿπÿßÿ® ÿßŸÑŸÖÿ™ÿßÿ≠ÿ© ŸàÿßŸÑŸÖÿ§ÿ¨ÿ±ÿ© ŸÖŸÜŸÅÿµŸÑŸäŸÜ
      const [availableResponse, rentedResponse] = await Promise.all([
        authService.getAvailableGames(),
        authService.getRentedGames()
      ]);
      
      if (availableResponse.success) {
        setAvailableGames(availableResponse.data || []);
      }
      
      if (rentedResponse.success) {
        setRentedGames(rentedResponse.data || []);
      }
      
    } catch (error) {
      setError('ÿ™ÿπÿ∞ÿ± ÿ™ÿ≠ŸÖŸäŸÑ ÿßŸÑÿ£ŸÑÿπÿßÿ®');
      console.error('Error loading separated games:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleReturnGame = async (gameId, rentalId) => {
    if (!window.confirm('ŸáŸÑ ÿ™ÿ±ŸäÿØ ÿ•ŸÜŸáÿßÿ° ÿ™ÿ£ÿ¨Ÿäÿ± Ÿáÿ∞Ÿá ÿßŸÑŸÑÿπÿ®ÿ©ÿü')) return;
    
    try {
      // ÿØÿßŸÑÿ© ŸÑÿ•ŸÉŸÖÿßŸÑ ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ± ÿ≥ÿ™ÿ£ÿ™Ÿä ŸÖŸÜ RentalService
      // const response = await rentalService.completeRental(rentalId);
      // if (response.success) {
      //   alert('ÿ™ŸÖ ÿ•ŸÜŸáÿßÿ° ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ± ÿ®ŸÜÿ¨ÿßÿ≠');
      //   loadGames();
      // }
      alert('ÿ≥Ÿäÿ™ŸÖ ÿ™ŸÜŸÅŸäÿ∞ ÿ•ŸÜŸáÿßÿ° ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ± ÿπŸÜÿØ ÿßŸÉÿ™ŸÖÿßŸÑ ÿµŸÅÿ≠ÿ© ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ±ÿßÿ™');
    } catch (error) {
      alert('ÿ™ÿπÿ∞ÿ± ÿ•ŸÜŸáÿßÿ° ÿßŸÑÿ™ÿ£ÿ¨Ÿäÿ±');
    }
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>ÿ¨ÿßÿ±Ÿä ÿ™ÿ≠ŸÖŸäŸÑ ÿßŸÑÿ£ŸÑÿπÿßÿ®...</p>
      </div>
    );
  }

  return (
    <div className="separated-games-page">
      <div className="page-header">
        <h1>üéÆ ÿßŸÑÿ£ŸÑÿπÿßÿ®</h1>
        <div className="stats-summary">
          <div className="stat-card">
            <div className="stat-label">ŸÖÿ™ÿßÿ≠ÿ©</div>
            <div className="stat-value">{availableGames.length}</div>
          </div>
          <div className="stat-card">
            <div className="stat-label">ŸÖÿ§ÿ¨ÿ±ÿ©</div>
            <div className="stat-value">{rentedGames.length}</div>
          </div>
          <div className="stat-card">
            <div className="stat-label">ÿ•ÿ¨ŸÖÿßŸÑŸä</div>
            <div className="stat-value">{availableGames.length + rentedGames.length}</div>
          </div>
        </div>
      </div>

      {error && (
        <div className="alert alert-error">
          {error}
        </div>
      )}

      <div className="tabs-container">
        <div className="tabs">
          <button 
            className={`tab ${activeTab === 'available' ? 'active' : ''}`}
            onClick={() => setActiveTab('available')}
          >
